  //   { name: "pen", tag: "What to buy", color: "blue" },
  //   { name: "pen", tag: "What to buy", color: "blue" },
  //   { name: "pen", tag: "What to buy", color: "blue" },
  //   { name: "pen", tag: "What to buy", color: "blue" },
  // ];

  return (
    <Container>
      <TodoContainer>
        <TodoBox>
          <div className="Header">
            <span>To do</span>
            <button>
              <img src={Plus}></img>
            </button>
          </div>
        </TodoBox>
        <TodoBox></TodoBox>
      </TodoContainer>
      <ScheduleBox></ScheduleBox>
    </Container>
  );
}
